import dynamic from 'next/dynamic'
import Head from 'next/head'

const DynamicComponent = dynamic(() => import('../components/Map'))

function Home() {
  return (
         <div>
            <Head>
                 <title>Empatica Dashboard</title>
            </Head>

            <DynamicComponent />
        </div>
  )
}

export default Home
